import React from "react";
import ReactDOM from "react-dom";
import abc, {favprog,myName} from "./App";

ReactDOM.render(
  <>
  <ol>
  <li> Hello </li>
  <li> {abc} </li>
  <li> {favprog} </li>
  <li> {myName} </li>
  </ol>
  </>,
  document.getElementById("root")
  );
